    "# Filter the dataset to include data from year 2000 onwards\n",
    "df_2000_onwards = df[df['Year'] >= 2000]\n",
    "\n",
    "# Drop missing values\n",
    "df_2000_onwards = df_2000_onwards.dropna(subset=['Year', 'Adjusted sea level (inches)'])\n",
    "\n",
    "# Perform linear regression using data from year 2000 onwards\n",
    "slope_2000, intercept_2000, _, _, _ = linregress(df_2000_onwards['Year'], df_2000_onwards['Adjusted sea level (inches)'])\n",
    "\n",
    "# Plot the scatter plot of the data\n",
    "plt.figure(figsize=(8, 6))\n",
    "plt.scatter(df['Year'], df['Adjusted sea level (inches)'], color='blue', label='Sea Level')\n",
    "\n",
    "# Plot the line of best fit for data from year 2000 onwards\n",
    "plt.plot(df_2000_onwards['Year'], slope_2000 * df_2000_onwards['Year'] + intercept_2000, color='red', label='Line of Best Fit (2000 Onwards)')\n",
    "\n",
    "# Predict sea level rise for the year 2050 using the rate since 2000\n",
    "sea_level_2050_predicted = slope_2000 * 2050 + intercept_2000\n",
    "plt.scatter(2050, sea_level_2050_predicted, color='green', label='Predicted Sea Level in 2050')\n",
    "\n",
    "# Add titles and labels\n",
    "plt.title('Rise in Sea Level')\n",
    "plt.xlabel('Year')\n",
    "plt.ylabel('Sea Level (inches)')\n",
    "\n",
    "\n",
    "plt.legend()\n",
    "plt.grid(True)\n",
    "plt.show()\n",
    "\n",
    "# Print the predicted sea level rise in 2050 using the rate since 2000\n",
    "print(\"Predicted Sea Level Rise in 2050 (Since 2000):\", sea_level_2050_predicted, \"inches\")\n"
